import React, { useState } from "react";
import "bootstrap/dist/css/bootstrap.css";

import { Nav, Navbar, Container } from "react-bootstrap";

function Navigation() {
  return (
    <div
      style={{
        display: "flex",
        alignItems: "center",
        justifyContent: "center",
        backgroundColor: "#474554",
        fontFamily: "Ubuntu",
      }}
    >
      <Navbar className="p-3">
        <Container>
          <Nav className="fs-2" style={{ gap: "10px" }}>
            <Nav.Link
              href="#home"
              className="nav-link"
              style={{ color: "#ACA7CB", transition: "0.5s all ease" }}
            >
              Home
            </Nav.Link>
            <Nav.Link
              href="#about"
              style={{ color: "#ACA7CB", transition: "0.5s all ease" }}
            >
              About
            </Nav.Link>
            <Nav.Link
              href="#contact"
              style={{ color: "#ACA7CB", transition: "0.5s all ease" }}
            >
              Recipes
            </Nav.Link>
            <Nav.Link
              href="#contact"
              style={{ color: "#ACA7CB", transition: "0.5s all ease" }}
            >
              Contact
            </Nav.Link>
            <Nav.Link style={{ color: "#ACA7CB", transition: "0.5s all ease" }}>
              Sign In
            </Nav.Link>
          </Nav>
        </Container>
      </Navbar>
    </div>
  );
}

export default Navigation;
